import { supabase } from "./supabaseClient";
import logo from './logo.svg';
import './App.css';

function App() {
  const clinics = fetchClinics();

  async function fetchClinics() {
    let { data: clinics, error } = await supabase
      .from('clinics')
      .select('*')
      .range(0, 9);
    return clinics;
  }

  return (
    <div className="App">
      <header className="App-header">
        <p>
          {clinics.name}
        </p>
      </header>
    </div>
  );
}

export default App;
